import "../style/WriteBoard.css";
import { Link } from "react-router-dom";

function WriteBoard() {
  return (
    <div
      className="background"
      style={{
        backgroundImage: "url(./background.png)",
        backgroundSize: "cover",
        width: "100%",
        height: "auto",
        backgroundRepeat: "repeat-y",
      }}
    ></div>
  );
}

export default WriteBoard;
